const Navbar = () => {
  return (
    <div className="p-0 m-0 d-flex row  justify-content-center align-items-center bg-danger">
      <div className="p-0"></div>
      <div>
        <h4>Bonte Takaway</h4>
      </div>
      <ul className="p-0 m-0 d-flex flex-row justify-content-center align-items-center">
        <li>Home</li>
        <li>About us</li>
        <li>Contact us</li>
      </ul>
    </div>
  );
};

export default Navbar;
